import React from "react";
import {EditOutlined} from "@ant-design/icons";
export default ({changeToFalse}) =>{
    return(
            <div style={{display:'flex',borderStyle:'dotted',
                marginRight:"60vw",marginTop:'10px',paddingLeft:'10px',marginLeft:'1px'}}>
                <div style={{borderTop:"1px solid lightgrey", fontSize:20}}>
                    <p>Account Number: </p>
                    <p>Name : </p>
                    <p>Aadhaar No : </p>
                    <p>PAN No: </p>
                </div>
                <div style={{cursor:"pointer",marginLeft:190}}>
                    <EditOutlined style={{fontSize:'30px'}} onClick={this.handleClick}/>
                </div>
                <button onClick={() => changeToFalse()}></button>
           </div>

    );
};
